    private void fetchChats() {
        Call<ChatsResponse> call = apiService.getChats();
        call.enqueue(new Callback<ChatsResponse>() {
            @Override
            public void onResponse(Call<ChatsResponse> call, Response<ChatsResponse> response) {
                if (response.isSuccessful() && response.body() != null) {
                    // Handle the response
                    ChatsResponse chatsResponse = response.body();
                    chatJsonList = chatsResponse.getChats();
                    UpdateChatList();
                    // TODO: Do something with the chats
                } else {
                    Toast.makeText(ChatList.this, "Failed to fetch chats", Toast.LENGTH_SHORT).show();
                }
            }

            @Override
            public void onFailure(Call<ChatsResponse> call, Throwable t) {
                Toast.makeText(ChatList.this, t.toString(), Toast.LENGTH_SHORT).show();
            }
        });
    }

    private void UpdateChatList(){
        chatJsonList.clear();
        for (Chat_json chatJson : chatJsonList) {
            String base64Image = chatJson.getImg();
            Bitmap bitmap = ImageUtils.decodeBase64ToBitmap(base64Image);
            //todo add constructor for chat takes things
            chat.add(new Chat(chatJson.getUsername() , chatJson.getLastMessage(), bitmap, chatJson.getUnreadCnt()));
        }
        Toast.makeText(ChatList.this, "Updated", Toast.LENGTH_SHORT).show();
        chatAdapter.notifyDataSetChanged(); // Notify the adapter of data changes
    }
    private void startChatRefreshTimer() {
        final Handler handler = new Handler();
        Runnable runnable = new Runnable() {
            @Override
            public void run() {
                fetchChats();
                handler.postDelayed(this, 5000); // Refresh every 5 seconds
            }
        };
        handler.post(runnable);
    }
